import React from "react";

import {useParams} from "react-router-dom";

export default function GameField(){
  let params = useParams();
  let gameId = params.gameId;
  return (
    <>
      <h4>Welcome from game field: {gameId}</h4>
      <div id = "gameBoardContainer">
        <div id = "gameBoardContainer">
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
          <div>5</div>
          <div>6</div>
        </div>
      </div>
    </>
  )
}
